    [],nt"revision_timestamp": "2016-01-30T06:45:27.807409",nt"name": "us-amlr-program-fish-dataset",nt"isopen":
    false,nt"url": null,nt"notes": "The AERD conducts semiannual bottom-trawl
    research surveys to characterize the populations and biological features of Antarctic
    demersal finfish species. These surveys allow the assessment of fish stocks and
    the understanding of species inventory, demographics, population dynamics and prospect
    of recovery. They also allow CCAMLR to asses the potential for reopening closed
    areas for harvest. These surveys are conducted in the Southern Scotia Arc region
    of the Southern Ocean, primarily around the South Shetland Islands, the Antarctic
    Peninsula, and the South Orkney Islands - areas where finfish fishing activities
    continue to be prohibited. Data collected during the finfish research surveys include
    biomass, spatial distribution, size and maturity, reproductive characteristics,
    age and growth and predator-prey interactions.",nt"license_title": null,nt"extras":
